replyComment:
@Vert Beke You believe what you want to believe but I think sales are real as Record labels have to pay taxes and copyrights for those sales too (I worked for a record label). Even record retunrs have be publicly destroid in order not to pay copyrights (that it's about 20% of the price of a CD or vinyl)
They may pay to inflate some radio airplay and streams sometimes or even discount some records sometimes (to achieve some certification milestones sooner) but that's different. Believe me sales are real. My dad owns over 200 records from Elvis Presley and over 100 records from The Beatles (and many of his friends too). 
I myself own over 200 records from Madonna (and I know many people that own over 1000 records and also over 100 from their favourite artist) so I believe sales are real.
